import React from "react";
import styled from "styled-components";

const HeaderContainer = styled.header`
background-color: greenyellow;
margin:15px;
padding: 16px;
height: 100px;
display: flex;
`

const Header = () => {
   return (
       <HeaderContainer>
     <h1>Spo</h1>>


       </HeaderContainer>

   )
}

export default Header
